      <path fill="#467886" d="M100 238.02L180 238.02 180 239.23 100 239.23z" /><text font-family="SimHei" font-style="normal" font-weight="normal" font-stretch="normal" font-size="15pt" fill="#747474" x="0" y="236.625"><tspan x="0" y="20.625">Followin是一款专注于Web3和加密行业的资讯聚合平台，提供全球区块链新闻、市场动态</tspan><tspan x="0" y="44.625" textLength="490">和深度分析，支持多语言内容覆盖和OIO积分激励体系。</tspan><tspan x="0" y="92.625" textLength="780">其Crypto News Feed API在亚洲市场表现突出，与Binance、OKX等交易所及Solana等公链</tspan><tspan x="0" y="116.625" textLength="140">生态保持合作。</tspan><tspan x="0" y="164.625" textLength="720">用户可通过每日任务（如阅读文章、分享内容）积累积分，未来可兑换空投奖励。</tspan><tspan x="0" y="188.625" textLength="810">Followin的移动端适配性强，支持iOS/Android平台，并集成Web3社交协议以增强社区互动。</tspan><tspan x="0" y="236.625" textLength="100">官网链接：</tspan><a xlink:href="https://followin.io/)"><tspan x="100" y="236.625" textLength="80" fill="#467886">Followin</tspan></a></text></g>
